import React from "react";
import styled from "styled-components";
import "./header.css";

function Header() {
  const Wrapper = styled.div`
    .landing {
      background: black;
      height: 80vh;
    }
  `;
  return (
    <Wrapper>
      <div className="jumbotron landing d-flex flex-column justify-content-center align-items-center">
        <h3 className="large text-white">
          <strong>user experience designer</strong>
        </h3>

        <div className="px-3 row mt-4">
          <div className="col-12 col-md-8 offset-md-2">
            <p className="lead text-white">
              I am a User Experience Designer and frontend Developer with over 2
              years experience in web development. I am skilled in working with
              modern UX Design tools like Figma and Adobe XD. I am also
              experienced in leading and working with a team.
            </p>
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default Header;
